using namespace std; 
using std::begin;

class Solution {
public:
    static int distributeCandies(vector<int>& candies) {
        int sum = 0;
        bool flag = true;
        vector<int> rlt;
        for (int i = 0; i < candies.size() && (sum < candies.size()/2); i++)
        {
            flag = true;
            for (int j = 0; j < rlt.size();j++)
            {
                if(rlt[j] == candies[i])
                {
                    flag = false;
                    break;
                }
            }
            if (flag == true)
            {
                rlt.push_back(candies[i]);
                sum++;
            }
        }
        
        if (sum < candies.size()/2)
        {
            return sum;
        }
        else
        {
            return candies.size()/2;
        }
    }
};

